import React, { Component } from "react";

class Table extends Component {
  render() {
    const { champions } = this.props;
    // console.log(champions);
    const list = Object.keys(champions).map((name) => {
      return name;
    });
    console.log(list);
    return (
      <table className="table">
        <thead>
          <tr>
            <th>Image</th>
            <th>Champion</th>
            <th>Role</th>
          </tr>
        </thead>
        <tbody>
          {list.map((i) => (
            <tr>
              <td>{i}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}

export default Table;
